import React from 'react';

import './App.css';
import { motion } from 'framer-motion';

function App() {
  return (
    <>
      <motion.div
        className='animBlock'
    animate={{ scale: 2 }}
    transition={{ duration: 0.5, repeat: Infinity, ease: '[0.17, 0.67, 0.83, 0.67]' }}
  />
    </>
  );
}

export default App;
